  error 
}) => {
  // DSLÂéüËØ≠ÂÆö‰πâ
  const dslPrimitives = {
    EVENT_ROUTE: {
      name: "EVENT_ROUTE",
      description: "‰∫ã‰ª∂Ë∑ØÁî±ÂéüËØ≠ - Êô∫ËÉΩË∑ØÁî±Â§çÊùÇ‰∫ã‰ª∂Âà∞ÂêàÈÄÇÁöÑÊô∫ËÉΩ‰Ωì",
      syntax: "EVENT_ROUTE(event_type, priority, target_agents)",
      example: "EVENT_ROUTE('traffic_incident', 'high', ['traffic_manager', 'safety_agent'])"
