      description: "ÁºìÂ≠ò‰ºòÂåñÂéüËØ≠ - ‰ºòÂåñÊô∫ËÉΩ‰ΩìÈó¥Êï∞ÊçÆÁºìÂ≠òÂíåÂÖ±‰∫´",
      syntax: "CACHE_OPTIMIZE(cache_strategy, ttl, agents)",
