      description: "Á≥ªÁªüË∞ÉÂ∫¶ÂéüËØ≠ - ÂçèË∞ÉÂ§öÊô∫ËÉΩ‰ΩìÊâßË°åÈ°∫Â∫èÂíåËµÑÊ∫êÂàÜÈÖç", 
      syntax: "SYSTEM_SCHEDULE(task_queue, resource_limit, execution_order)",
      example: "SYSTEM_SCHEDULE(['analyze', 'optimize', 'execute'], 'cpu:80%', 'sequential')"
    },
    AGENT_COLLABORATE: {
      name: "AGENT_COLLABORATE",
      description: "Êô∫ËÉΩ‰ΩìÂçè‰ΩúÂéüËØ≠ - ÂÆûÁé∞Êô∫ËÉΩ‰ΩìÈó¥ÁöÑÂÆûÊó∂Âçè‰ΩúÂíåÈÄö‰ø°",
      syntax: "AGENT_COLLABORATE(collaboration_type, participants, protocol)",
      example: "AGENT_COLLABORATE('consensus', ['traffic', 'safety'], 'broadcast')"
    },
    LLM_DRIVE: {
      name: "LLM_DRIVE",
      description: "LLMÈ©±Âä®ÂéüËØ≠ - Âà©Áî®Â§ßËØ≠Ë®ÄÊ®°ÂûãËøõË°åÊô∫ËÉΩÂÜ≥Á≠ñÂíå‰ªªÂä°ÂàÜËß£",
      syntax: "LLM_DRIVE(prompt_template, context, output_format)",
      example: "LLM_DRIVE('analyze_traffic_pattern', sensor_data, 'json')"
    }
  };

  // Ê†πÊçÆÈò∂ÊÆµËé∑ÂèñÂØπÂ∫îÁöÑDSLÂéüËØ≠
  const getDSLPrimitiveForPhase = (phase) => {
    const phaseToPrimitive = {
      'LEADER_RECEIVE_TASK': 'EVENT_ROUTE',
      'MEETING_ANALYSIS': 'LLM_DRIVE',
      'TASK_DISTRIBUTION': 'SYSTEM_SCHEDULE',
      'AGENT_COLLABORATION': 'AGENT_COLLABORATE',
      'TASK_EXECUTION': 'EVENT_ROUTE',
      'ISSUE_REPORTING': 'EVENT_ROUTE',
      'ISSUE_RESOLUTION': 'LLM_DRIVE',
      'TASK_REDISTRIBUTION': 'SYSTEM_SCHEDULE',
      'FINAL_EXECUTION': 'AGENT_COLLABORATE',
      'FINAL_REVIEW': 'LLM_DRIVE'
    };

    const primitiveName = phaseToPrimitive[phase] || 'EVENT_ROUTE';
    return dslPrimitives[primitiveName];
  };
  const getWorkflowStepIcon = (phase) => {
    const icons = {
      'LEADER_RECEIVE_TASK': 'üëë',
      'MEETING_ANALYSIS': 'üß†',
      'TASK_DISTRIBUTION': 'üìã',
      'AGENT_COLLABORATION': 'üí¨',
      'TASK_EXECUTION': '‚ö°',
      'ISSUE_REPORTING': '‚ö†Ô∏è',
      'ISSUE_RESOLUTION': 'üîß',
      'TASK_REDISTRIBUTION': 'üîÑ',
      'FINAL_EXECUTION': '‚úÖ',
      'FINAL_REVIEW': 'üìä'
    };
    return icons[phase] || 'üìù';
  };

  const getWorkflowStepTitle = (phase) => {
    const titles = {
      'LEADER_RECEIVE_TASK': 'MasterÊô∫ËÉΩ‰ΩìÊé•Êî∂‰ªªÂä°',
      'MEETING_ANALYSIS': 'MasterÊô∫ËÉΩ‰ΩìÂàÜÊûê‰ªªÂä°',
      'TASK_DISTRIBUTION': 'MasterÊô∫ËÉΩ‰ΩìÂàÜÈÖç‰ªªÂä°',
      'AGENT_COLLABORATION': 'Â≠êÊô∫ËÉΩ‰ΩìÂçè‰Ωú‰∫§ÊµÅ',
      'TASK_EXECUTION': 'Â≠êÊô∫ËÉΩ‰ΩìÊâßË°å‰ªªÂä°',
      'ISSUE_REPORTING': 'Êô∫ËÉΩ‰ΩìÊ±áÊä•ÈóÆÈ¢ò',
      'ISSUE_RESOLUTION': 'MasterÊô∫ËÉΩ‰ΩìÂà∂ÂÆöËß£ÂÜ≥ÊñπÊ°à',
      'TASK_REDISTRIBUTION': 'MasterÊô∫ËÉΩ‰ΩìÈáçÊñ∞ÂàÜÈÖç‰ªªÂä°',
      'FINAL_EXECUTION': 'Â≠êÊô∫ËÉΩ‰ΩìÂÆåÊàêÊúÄÁªà‰ªªÂä°',
      'FINAL_REVIEW': 'MasterÊô∫ËÉΩ‰ΩìÊÄªÁªìÂ§çÁõò'
    };
    return titles[phase] || phase;
  };

  const getWorkflowStepDescription = (phase) => {
    const descriptions = {
      'LEADER_RECEIVE_TASK': 'MasterÊô∫ËÉΩ‰Ωì‰∫ÆËµ∑ÔºåÂºÄÂßãÊé•Êî∂Áî®Êà∑‰ªªÂä°',
      'MEETING_ANALYSIS': 'MasterÊô∫ËÉΩ‰Ωì‰ΩøÁî®LLMÂàÜÊûê‰ªªÂä°ÔºåÂà∂ÂÆöÂçè‰ΩúÁ≠ñÁï•',
      'TASK_DISTRIBUTION': 'MasterÊô∫ËÉΩ‰ΩìÂêëÂ≠êÊô∫ËÉΩ‰ΩìÂàÜÈÖçÂÖ∑‰Ωì‰ªªÂä°',
      'AGENT_COLLABORATION': 'Â≠êÊô∫ËÉΩ‰ΩìÂºÄÂßãÂçè‰Ωú‰∫§ÊµÅÔºåÂÖ±‰∫´‰ø°ÊÅØ',
      'TASK_EXECUTION': 'Â≠êÊô∫ËÉΩ‰ΩìÂºÄÂßãÊâßË°åÂÖ∑‰Ωì‰ªªÂä°',
      'ISSUE_REPORTING': 'Êô∫ËÉΩ‰ΩìÂêëMasterÊô∫ËÉΩ‰ΩìÊ±áÊä•ÈóÆÈ¢ò',
      'ISSUE_RESOLUTION': 'MasterÊô∫ËÉΩ‰ΩìÂàÜÊûêÈóÆÈ¢òÔºåÂà∂ÂÆöËß£ÂÜ≥ÊñπÊ°à',
      'TASK_REDISTRIBUTION': 'MasterÊô∫ËÉΩ‰ΩìÈáçÊñ∞ÂàÜÈÖç‰ªªÂä°ÔºåË∞ÉÊï¥ÊâßË°åÁ≠ñÁï•',
      'FINAL_EXECUTION': 'Â≠êÊô∫ËÉΩ‰ΩìÂçè‰ΩúÂÆåÊàêÊúÄÁªà‰ªªÂä°',
      'FINAL_REVIEW': 'MasterÊô∫ËÉΩ‰ΩìÂπøÊí≠ÊúÄÁªàÁªìÊûúÔºåËøõË°åÂ§çÁõòÊÄªÁªì'
    };
    return descriptions[phase] || 'ÊâßË°åÂ∑•‰ΩúÊµÅÊ≠•È™§';
  };

  const workflowSteps = interactionHistory.filter(item => item.type === 'workflow_step');

  return (
    <div className="workflow-executor">
      <div className="executor-header">
        <h3 className="executor-title">üöÄ Multi-Agent DSL Â∑•‰ΩúÊµÅÊâßË°å</h3>
        <div className="executor-subtitle">ÂÆûÊó∂Â±ïÁ§∫Â§öÊô∫ËÉΩ‰ΩìÂçè‰ΩúËøáÁ®ã</div>
      </div>

      {isLoading && (
        <div className="loading-overlay">
          <div className="loading-content">
            <div className="loading-spinner-large"></div>
            <p className="loading-text">Ê≠£Âú®Â§ÑÁêÜ‰ªªÂä°...</p>
            <p className="loading-subtext">Multi-Agent DSL Framework Ê≠£Âú®ÂçèË∞ÉÊô∫ËÉΩ‰ΩìÊâßË°å</p>
          </div>
        </div>
      )}

      {error && (
        <div className="error-banner">
          <div className="error-content">
            <span className="error-icon">‚ö†Ô∏è</span>
            <span className="error-message">{error}</span>
          </div>
        </div>
      )}

      <div className="workflow-timeline">
        {workflowSteps.length > 0 ? (
          workflowSteps.map((step, index) => (
            <div key={step.id} className="workflow-step">
              <div className="step-indicator">
                <div className="step-icon">
                  {getWorkflowStepIcon(step.phase)}
                </div>
                <div className="step-number">{index + 1}</div>
              </div>

              <div className="step-content">
                <div className="step-header">
                  <h4 className="step-title">{getWorkflowStepTitle(step.phase)}</h4>
                  <span className="step-time">{step.timestamp}</span>
                </div>

                <div className="step-description">
                  {getWorkflowStepDescription(step.phase)}
                </div>

                {step.dsl && (
                  <div className="dsl-info">
                    <div className="dsl-header">
                      <span className="dsl-icon">üîß</span>
                      <span className="dsl-title">DSLÂéüËØ≠: {step.dsl.primitive}</span>
                    </div>
                    <div className="dsl-details">
                      <div className="dsl-syntax">
                        <span className="syntax-label">ËØ≠Ê≥ï:</span>
                        <code className="syntax-code">{step.dsl.syntax}</code>
                      </div>
                      <div className="dsl-example">
                        <span className="example-label">Á§∫‰æã:</span>
                        <code className="example-code">{step.dsl.example}</code>
                      </div>
                    </div>
                  </div>
                )}

                {/* Â¶ÇÊûúÊ≤°ÊúâDSL‰ø°ÊÅØÔºå‰ΩøÁî®ÈªòËÆ§ÁöÑDSLÂéüËØ≠ */}
                {!step.dsl && step.phase && (
                  <div className="dsl-info">
                    <div className="dsl-header">
                      <span className="dsl-icon">üîß</span>
                      <span className="dsl-title">DSLÂéüËØ≠: {getDSLPrimitiveForPhase(step.phase).name}</span>
                    </div>
                    <div className="dsl-details">
                      <div className="dsl-description">
                        <span className="description-label">ÊèèËø∞:</span>
                        <span className="description-text">{getDSLPrimitiveForPhase(step.phase).description}</span>
                      </div>
                      <div className="dsl-syntax">
                        <span className="syntax-label">ËØ≠Ê≥ï:</span>
                        <code className="syntax-code">{getDSLPrimitiveForPhase(step.phase).syntax}</code>
                      </div>
                      <div className="dsl-example">
                        <span className="example-label">Á§∫‰æã:</span>
                        <code className="example-code">{getDSLPrimitiveForPhase(step.phase).example}</code>
                      </div>
                    </div>
                  </div>
                )}

                {step.agents && step.agents.length > 0 && (
                  <div className="participants">
                    <span className="participants-label">ÂèÇ‰∏éËÄÖ:</span>
                    <div className="participants-list">
                      {step.agents.map((agent, idx) => (
                        <span key={idx} className="participant-tag">
                          {agent.name}
                        </span>
                      ))}
                    </div>
                  </div>
                )}
              </div>
            </div>
          ))
        ) : (
          <div className="empty-workflow">
            <div className="empty-icon">üìã</div>
            <h4 className="empty-title">ÊöÇÊó†Â∑•‰ΩúÊµÅÊâßË°åËÆ∞ÂΩï</h4>
            <p className="empty-message">
              ÈÄâÊã©Êô∫ËÉΩ‰ΩìÂπ∂ÊâßË°å‰ªªÂä°ÂêéÔºåËøôÈáåÂ∞ÜÊòæÁ§∫ËØ¶ÁªÜÁöÑMulti-Agent DSLÂ∑•‰ΩúÊµÅÊâßË°åËøáÁ®ã
            </p>

            {/* ÊòæÁ§∫DSLÂéüËØ≠Á§∫‰æã */}
            <div className="dsl-primitives-showcase">
              <h5 className="showcase-title">üîß DSLÂéüËØ≠Á§∫‰æã</h5>
              <div className="primitives-grid">
                {Object.values(dslPrimitives).map((primitive, index) => (
                  <div key={index} className="primitive-card">
                    <div className="primitive-header">
                      <span className="primitive-icon">üîß</span>
                      <span className="primitive-name">{primitive.name}</span>
                    </div>
                    <div className="primitive-description">
                      {primitive.description}
                    </div>
                    <div className="primitive-syntax">
                      <span className="syntax-label">ËØ≠Ê≥ï:</span>
                      <code className="syntax-code">{primitive.syntax}</code>
                    </div>
                    <div className="primitive-example">
                      <span className="example-label">Á§∫‰æã:</span>
                      <code className="example-code">{primitive.example}</code>
                    </div>
                  </div>
                ))}
              </div>
            </div>
          </div>
        )}
      </div>
    </div>
  );
};

export default WorkflowExecutor;
